} case;

feature liga {
# automatic
lookupflag IgnoreMarks;
sub f i by fi;
sub f l by fl;

} liga;

feature calt {
sub @figures colon' by colon.case;
sub colon' @figures by colon.case;

sub @figures_tf colon.tf' by colon.tf.case;
sub colon.tf' @figures_tf by colon.tf.case;
} calt;

